@base <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <> .

atm:ATM rdf:type owl:Class .
atm:BankComputer rdf:type owl:Class .
atm:BankCode rdf:type owl:DatatypeProperty .
atm:Password rdf:type owl:DatatypeProperty .

atm:verifies rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:BankComputer .

atm:hasBankCode rdf:type owl:DatatypeProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:BankCode .

atm:hasPassword rdf:type owl:DatatypeProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Password .

atm:ATM rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:verifies ;
    owl:someValuesFrom [ rdf:type owl:Class ;
        owl:intersectionOf ( atm:BankComputer
            [ rdf:type owl:Restriction ;
                owl:onProperty atm:hasBankCode ;
                owl:someValuesFrom rdf:Literal ]
            [ rdf:type owl:Restriction ;
                owl:onProperty atm:hasPassword ;
                owl:someValuesFrom rdf:Literal ] ) ] ] .
